import React, { useState } from 'react';
import { useStateContext } from '../context/StateContext';

const YourAddress = () => {
  const { state, dispatch } = useStateContext();
  const [showForm, setShowForm] = useState(false);
  const [address, setAddress] = useState({
    firstName: '',
    lastName: '',
    mobile: '',
    address1: '',
    address2: '',
    pincode: '',
    city: '',
    state: '',
  });

  const handleChange = (e) => {
    setAddress({ ...address, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    dispatch({ type: 'ADD_ADDRESS', payload: address });
    setShowForm(false);
  };

  return (
    <div className="generic-page">
      <h1>Your Addresses</h1>
      {state.addresses.length === 0 && !showForm && (
        <button className="add-to-cart" onClick={() => setShowForm(true)}>Add Address</button>
      )}

      {showForm && (
        <form onSubmit={handleSubmit} className="admin-form">
          <div className="admin-form-group">
            <label>First Name</label>
            <input type="text" name="firstName" onChange={handleChange} />
          </div>
          <div className="admin-form-group">
            <label>Last Name</label>
            <input type="text" name="lastName" onChange={handleChange} />
          </div>
          <div className="admin-form-group">
            <label>Mobile Number</label>
            <input type="text" name="mobile" onChange={handleChange} />
          </div>
          <div className="admin-form-group">
            <label>Address Line 1</label>
            <input type="text" name="address1" onChange={handleChange} />
          </div>
          <div className="admin-form-group">
            <label>Address Line 2</label>
            <input type="text" name="address2" onChange={handleChange} />
          </div>
          <div className="admin-form-group">
            <label>Pincode</label>
            <input type="text" name="pincode" onChange={handleChange} />
          </div>
          <div className="admin-form-group">
            <label>City</label>
            <input type="text" name="city" onChange={handleChange} />
          </div>
          <div className="admin-form-group">
            <label>State</label>
            <input type="text" name="state" onChange={handleChange} />
          </div>
          <button type="submit" className="add-to-cart">Save Address</button>
        </form>
      )}

      {state.addresses.map((addr, index) => (
        <div key={index} className="feature-card">
          <p>{addr.firstName} {addr.lastName}</p>
          <p>{addr.address1}, {addr.address2}</p>
          <p>{addr.city}, {addr.state} - {addr.pincode}</p>
          <p>Mobile: {addr.mobile}</p>
        </div>
      ))}
    </div>
  );
};

export default YourAddress;
